  if_this_permission_is_enabled_and_courses_view_lis_cdf22691: "Om den här behörigheten är aktiverad och Kurser – visa lista är inaktiverat, kan användare lägga till en ny kurs med knappen Lägg till en ny kurs i Kontoinställningar."
  if_this_permission_is_enabled_users_do_not_need_th_49974dc2: "Om den här behörigheten är aktiverad behöver inte användare aktivera SIS-data-läsbehörighet. Kontobehörigheten åsidosätter kursbehörigheten. För att förhindra läsare att hantera SIS-ID:n på kursnivå måste även SIS-Data – hantera samt SIS-Data – läs aktiveras. För att lägga till användare till kurser via SIS-ID måste även Användare – lägg till/ta bort elever från kurser och/eller Användare – lägg till/ta bort lärare, kursdesigners eller TA:er från kurser aktiveras."
  if_this_permission_is_enabled_users_do_not_need_th_e3d0f334: |-
