  to_edit_blueprint_course_settings_in_course_settin_59befcfa: "För att redigera Blueprint-kursinställningar i Kursinställningar måste även Blueprint-kurser – lägg till/redigera/koppla/ta bort aktiveras. För att lägga till en kopplad kurs måste även Blueprint-kurser – lägg till/redigera/koppla/ta bort samt Kurser – visa lista aktiveras. För att redigera låsinställningar på modellobjekttyper måste den här behörigheten vara aktiverad. För att redigera låsinställningarna på filer måste även Kursfiler – lägg till/redigera/ta bort vara aktiverat. För att redigera låsinställningarna för quiz måste även Uppgifter och Quiz – lägg till/redigera/ta bort vara aktiverat."
